from DataStream.ByteReader import ByteReaderfrom Protocol.Messages.Server.LeaderboardMessage import LeaderboardMessagefrom Protocol.Messages.Server.LeaderboardBrawler import LeaderboardBrawlerfrom Logic.Player import Playerfrom Protocol.Messages.Server.AvailableServerCommandMessage import AvailableServerCommandMessageclass GetLeaderboardMessage(ByteReader):	def __init__(self, client, crypto, player, initial_bytes):		super().__init__(initial_bytes)		self.client = client		self.crypto = crypto		self.player = player			def decode(self):		self.local = self.readVInt()		self.type = self.readVInt()		self.readVInt()		self.brwl = self.readVInt()		def process(self):		print(f"Is Local?: {self.local}\nType: {self.type}\nBrawler: {self.brwl}")		if self.type == 1:			LeaderboardMessage(self.client, self.player).send(self.crypto)		else:			LeaderboardBrawler(self.client, self.player, self.brwl).send(self.crypto)			